import {createSlice} from "@reduxjs/toolkit";

const state = {
    userAdvertise: []
}

const slice = createSlice({
    name: "user",
    initialState: state,
    reducers: {
        getUserAdvertise(state, action){},
        getUserAdvertiseSuccess(state, action){
            state.userAdvertise = action.payload;
        }
    }
})

export const {getUserAdvertise, getUserAdvertiseSuccess} = slice.actions
export default slice.reducer
